function Task(taskobject) {
    const task=taskobject.task;




    return(
        <div>
        <h5>
        {task.taskname} 
        {task.completion && <h6 className='completed'>Completed</h6>}
        {!(task.completion) && 'Not completed'}
        </h5>
        <button>Edit</button>
        <button>Delete</button>


        </div>
    );
}

export default Task;
